  false,\n\t\"url\": null,\n\t\"notes\": \"Attendance boundaries for middle schools
  in the Chicago Public Schools district for school year 2016-2017. Note: only 25
  middle schools have attendance boundaries in school year 2016-2017. Middle school
  boundaries are often established to relieve overcrowding at nearby elementary schools.
  Generally, all students in the applicable middle school grades who live within one
  of these boundaries may attend the school. To view or use these shapefiles, compression
  software, such as 7-Zip, and special GIS software, such as Google Earth or ArcGIS,
  are required.\",\n\t\"owner_org\": \"86c0c3d9-3826-47ab-a773-6924b858dd04\",\n\t\"extras\":
